import React from "react";
const Address = (props) => {
    const address=props.address;
    return (<div>
        props.any
        <h2>{props.cityName}</h2>
        <h2>{props.society}</h2>
        <h2>{address.residationType}</h2>
    </div>)
}
export default Address
